function qk2xy(qk) {
    let tileX = 0
    let tileY = 0
    const lvl = qk.length
    for (let i = lvl; i > 0; i--) {
        let mask = 1 << (i - 1)
        switch (qk[lvl - i]) {
            case '0':
                break;
            case '1':
                tileX |= mask;
                break;
            case '2':
                tileY |= mask;
                break;
            case '3':
                tileX |= mask;
                tileY |= mask;
                break;
            default:
                throw new Error('Invalid key')
        }
    }
    return [tileX, tileY]
}

